import React from 'react';
import { people } from './people';
import Card from './Card';

const CardList = () => {
    return (
        <div>
                <Card species={people[0].species} name={people[0].name} gender={people[0].gender} weight={people[0].mass} />
                <Card species={people[1].species} name={people[1].name} gender={people[1].gender} weight={people[1].mass} />
                <Card species={people[2].species} name={people[2].name} gender={people[2].gender} weight={people[2].mass} />
                <Card species={people[3].species} name={people[3].name} gender={people[3].gender} weight={people[3].mass} />
                <Card species={people[4].species} name={people[4].name} gender={people[4].gender} weight={people[4].mass} />
                <Card species={people[5].species} name={people[5].name} gender={people[5].gender} weight={people[5].mass} />
                <Card species={people[6].species} name={people[6].name} gender={people[6].gender} weight={people[6].mass} />
                <Card species={people[7].species} name={people[7].name} gender={people[7].gender} weight={people[7].mass} />

        </div>
    );
    
}

export default CardList
